package db.domain;import java.util.Arrays;public class ResetUserImpl implements ResetUser {	@Key	private String uname;	private int newestUserIdIndex;	public ResetUserImpl() {	}	public ResetUserImpl(ResetUser c) {		this.uname = c.getUname();		this.newestUserIdIndex = c.getNewestUserIdIndex();	}	@Override	public String tableName() {		return "reset_user";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setNewestUserIdIndex(int newestUserIdIndex) {		this.newestUserIdIndex = newestUserIdIndex;	}	public int getNewestUserIdIndex() {		return this.newestUserIdIndex;	}public void addNewestUserIdIndex(int newestUserIdIndex) {		this.newestUserIdIndex += newestUserIdIndex;}}